import React from 'react';
import { TextInput, StyleSheet } from 'react-native';

export default function (props) {
    return (
        <TextInput
            {...props}
            style={CSS.inputField}
        />
    );
}
const CSS = StyleSheet.create({
    inputField: {
        borderBottomColor: 'dodgerblue',
        borderBottomWidth: 1,
        marginHorizontal: 20,
        marginVertical: 10,
        padding: 10
    }
});
